import React from 'react';
import * as C from './styles';

const Button = ({ text, onClick, type = 'button', fontSize, width, butt }) => {
  const ButtonStyle = {
    fontSize: fontSize,
    width: width
  }

  return (
    <C.Button
      type={type}
      onClick={onClick}
      style={ButtonStyle}
    >
      {text}

      <Help ButtonStyle={ButtonStyle} />
    </C.Button>

    
  )
}

export default Button
